import React, {Component} from 'react';
import { StyleSheet, Button, View, Text } from 'react-native';

export class HomeScreen extends Component {
    render = () => {
    return (
        <View style={{flex: 1, alignItems: 'left', justifyContent: 'left', backgroundColor: '#faf9f8', paddingTop: '1%',paddingBottom:'1%'}}>
            <Button
                title="Категории карточек"
                onPress={() => this.props.navigation.push('Categories')} />

            <Text h2 style={{flex: 2, alignItems: 'left', paddingTop: 5, paddingBottom:5, marginLeft: '2%', color: '#742774', fontSize: 28}}>Карточки для самого начала</Text>
            <Text h2 style={{flex: 2, alignItems: 'left', paddingTop: 5, justifyContent: 'left', paddingBottom: 5, marginLeft: '2%', color: '#a4262c', fontSize: 28}}>Категории для старта</Text>
        </View>
        )
    }
}
